;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;aircraft/predicts</span>","value":"#'aircraft/predicts"}
;; <=

;; **
;;; Let's see what predicts are available:
;; **

;; @@
(first predicts)
