;;; {"type":"html","content":"<span class='clj-var'>#&#x27;aircraft/avg-nas-end</span>","value":"#'aircraft/avg-nas-end"}
;; <=

;; @@
 (compose
    (list-plot avg-nas-beg :color "#00cccc" 
                    :plot-range [[0 N] [0 10]]
                    :joined true)
    (list-plot avg-nas-end :color "#cc00cc" :joined true))
